<head>

    <title>Document</title>
    <style>
        body{
            width: 1200px;
            margin: 10px auto;
        }
        header{
            border: 1px solid #ccc;
            padding-right: 20px;
        }
        ul{
            display:  flex;
            justify-content: flex-end;
            align-items: center;
            list-style: none;
            gap: 30px;
        }
        ul img{
            width: 30px;
            height: 30px;
        }
        li a{
            text-decoration: none;
            font-weight: 900;
            color: black;
        }
        .google-logo{
            border: 1px solid #ccc;
        }
        .google-logo img{
            display: block;
            width: 40%;
            margin: 0 auto;   
        }
        .search-bar{
            width: 50%;
            height: 40px;
            margin: 0 auto;
            display: flex;
            align-items: center;
            border: 2px solid #ccc; 
            border-radius: 20px;    
            position: relative;  
        }
        .search-bar img {
            position: absolute;
            width: 40px;
        }
        .search-text{
            margin-left: 70px;
            border: none;
            outline: none;
        }
        .search-icon{
            left: 5px;
        }
        .search-mic-icon{
            right: 80px;
        }
        .search-cam-icon{
            right: 30px;
        }
        .plus{
            padding: 30px 300px;
        }
        .plus ul{
            display: flex;
            justify-content: space-around;
            border: 1px solid #ccc;
        }
        .plus li{
            text-align: center;
        }
        .plus img{
            width: 50px;
            height: 50px;
            border: 4px solid white;
            border-radius: 50px;
        }
        .plus span{
            display: block;
            font-weight: 700;
        }
    </style>
